// datos del PLC del Bull
var PLC = global.get('PLC.Data','memoryOnly')||{};
var PLCDC = global.get('PLCDC.Data','memoryOnly')||{};
var PLCCILA = global.get('PLCCILA.Data','memoryOnly')||{};



// condicion de simulacion
var simulacion = global.get('simulation.state')||false;
// variables motor bull
var Motor_RPM = 0, Motor_VAC = 0, Motor_AMP = 0, Motor_KW = 0, Motor_LbFt = 0,factorPotencia = 0,vibracion = 0,temperatura= 0;
// variables del motor DC
var LoadDC = 0,voltajeDC = 0,corrienteDC= 0;

if(!simulacion){

    // VARIABLES plc local
    Motor_RPM =  indeterminado(PLC.RPM).toFixed(1);
    temperatura = indeterminado(PLC.Temperatura).toFixed(1);
    Motor_AMP = indeterminado(PLC.CorrienteABB).toFixed(1);
    vibracion = indeterminado(PLC.Vibracion).toFixed(1);

    // variables cila
    Motor_VAC = indeterminado(PLCCILA["SWC.VSD.VSD_I.P10_OutputVoltage"]).toFixed(1)
    Motor_AMP = indeterminado(PLCCILA["SWC.VSD.VSD_I.Feedback"]).toFixed(1)
    Motor_KW = indeterminado(PLCCILA["SWC.VSD.VSD_I.P10_OutputPower"]).toFixed(1)
    factorPotencia = indeterminado(PLCCILA["SWC.VSD.VSD_I.P13_PowerFactor"]).toFixed(3)

    // variables del PLC Motor DC
    LoadDC = indeterminado(PLCDC.DC_LoadSent).toFixed(1);
    voltajeDC = indeterminado(PLCDC.DC_OutputVoltage).toFixed(1);
    corrienteDC = indeterminado(PLCDC.DC_CurrentLimit).toFixed(1);

}else{
    Motor_RPM      = getRandomArbitrary(50,51,false);
    Motor_VAC      = getRandomArbitrary(50,55,false);
    Motor_AMP      = getRandomArbitrary(100,110,false);
    Motor_KW       = getRandomArbitrary(56,58,false);
    Motor_LbFt     = getRandomArbitrary(10,15,false);
    factorPotencia = getRandomArbitrary(0.9,1,false,3);
    vibracion      = getRandomArbitrary(1.3,2,false,3);
    temperatura    = getRandomArbitrary(25,26,false,2);


    // variables del dc
    LoadDC         = getRandomArbitrary(30,32,false,2);
    voltajeDC      = getRandomArbitrary(650,651,false,2);
    corrienteDC    = getRandomArbitrary(30,32,false,2);

}




// estructura del mensaje para enviar
msg.Motor_RPM = Motor_RPM + " RPM";
msg.Motor_VAC = Motor_VAC + " V";
msg.Motor_AMP = Motor_AMP + " AMP";
msg.Motor_KW = Motor_KW + " KW";
msg.Motor_LbFt = Motor_LbFt + " lb/ft";
msg.Motor_FP = factorPotencia + 'FP';
msg.Real_RPM = 3422 + " RPM";
msg.Carga = 97 + " %";
msg.Vibracion = vibracion + " mm/s^2";
msg.Temperatura = temperatura + " °C";


// valores de voltaje motor DC
msg.loadDC = LoadDC + ' %';
msg.voltajeDC = voltajeDC + ' V';
msg.corrienteDC = corrienteDC + ' A';

context.set('variable',msg,'memoryOnly');
return msg;
// funcion para generar numeros aleatorios
function getRandomArbitrary(min, max, entero = false,decimales = 1) {//Funcion para generar numero random
    if (entero) {
        return parseInt(Math.random() * (max - min) + min);
    } else {
        return parseFloat((Math.random() * (max - min) + min)).toFixed(decimales);
    }
}

// funcion para determinar si esta definido
function indeterminado(value){
    if (isNaN(value)){
        return 0;
    } else if (typeof value === 'undefined'){
        return 0;
    }else{
        return value;
    }
}

