function indeterminado(value,decimales = 1) {
    if (isNaN(value)) {
        return 0;
    } else if (typeof value === 'undefined') {
        return 0;
    } else {
        return parseFloat(value.toFixed(decimales));
    }
}

var Datalogger = global.get("Datalogger");

if (typeof Datalogger != 'undefined' && Datalogger.Units === 'Segundos')
    {
        msg.payload = Datalogger.Magnitude;
    }

else if (typeof Datalogger != 'undefined' && Datalogger.Units === 'Minutos')
    {
        msg.payload = Datalogger.Magnitude*60;
    }

else if (typeof Datalogger != 'undefined' && Datalogger.Units === 'Horas')
    {
        msg.payload = Datalogger.Magnitude*3600;
    }

return msg;

// Leer varibables del contexto
var Rate = global.get("Datalogger.Rate_Data");
var enable1 = global.get("Datalogger.Activated");
var Bandera = flow.get("Datalogger.Flag") || false;
var FechaFinal = context.get("FinalDate") || "";

// Definiciones
var TakeSample = false;
var CurrentDate = new Date();

if (enable1 === true){
    if (Bandera === false ){
        var DateString = CurrentDate.toString();
        FechaFinal = new Date(DateString);
        FechaFinal.setSeconds( FechaFinal.getSeconds() + Rate);
        context.set("FinalDate",FechaFinal);
        Bandera = true;   
        TakeSample = false;
    }
    else {
        if (CurrentDate >= FechaFinal){
            TakeSample = true;
            Bandera = false;
        }
    }
    msg.payload = {
        'Current'   : CurrentDate,
        'Final'     : FechaFinal,
        'TakeSample': TakeSample
    }
}

flow.set("Datalogger.Flag",Bandera);
node.status({fill:"red",shape:"ring",text:"Bandera: "+Bandera+" Fecha: "+FechaFinal});

return msg;

